import { Component } from '@angular/core';

@Component({
  selector: 'app-modal',
  templateUrl: './modal.component.html',
  styleUrls: ['./modal.component.css']
})
export class ModalComponent {
  constructor(public theme: int) { this.setTheme = theme; }
  public isOpen = true;
  public setTheme = 0;
}
